import React from 'react';
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';

export default function DatePickerExample() {
    return (
        <TextField 
            label='Birthday'
            type='date'
            defaultValue='2020-12-10'
            InputLabelProps={{
                shrink: true,
            }} 
        />
    );
}
